import './Text.css'
import React,{useState} from 'react';
const Text = () => {
    const [input,setInput] = useState('RESULT');

    return( 
        <div className="text">
            <div className='io'>
                <textarea onChange={(event) => setInput(event.target.value)} className="textIn" value={input} placeholder='Type/Paste Here'></textarea>
                <div className='result'>
                    {input}
                </div>
            </div>
            <button className="textButton">Analyze</button>
        </div>
    )
}

export default Text;
